import { useState } from 'react';
import './Counter.css';


function Counter(){
    const [count, setCount] = useState(0)
    const incFn = ()=>{
      setCount(count+1)
    }
    return(
        <div>
            counter = {count}
            <div>
                <button onClick={incFn}>DEC</button>
                <button onClick={incFn}>INC</button>
            </div>
        </div>
        
    );
}







export default Counter;
